    NavbarSticky,
    Section,
} from 'uikit-react';

class App extends Component {
  render() {
    return (
        <ul class="uk-breadcrumb">
          <li><a href=""></a></li>
      <li><a href=""></a></li>
      <li><span></span></li>
      </ul>
    );
  }
}

export default App;
